import React from 'react'
import Botoes from './BotoesCalc'
import Display from './DisplayCalc'

export default class Calculadora extends React.Component
{
    constructor(props) {
        super(props)
    }

    state = {
        numero1:  '',
        numero2:  '',
        operacao: '',
        resultado: ''
    };

    render(){
        return(
        <div className="Calculadora">
            <Display Resultado = {this.state.resultado} Numero1 = {this.state.numero1} Numero2 = {this.state.numero2} Operacao = {this.state.operacao}/>
            <Botoes incNum = {this.incNum} setOperacao = {this.setOperacao} setResultado = {this.setResultado}/>
        </div>
    )}
}
